import { GET_USER_CRM } from "./valiable.reducer";

const initialState = {
    dataUser: {}
}

export const userReducer = (state = initialState, { type, payload }) => {
    switch (type) {
        case GET_USER_CRM: {
            console.log(payload);
            state.dataUser = payload.datas;
            return { ...state, ...payload }
        }

        default:
            return state
    }
}
